    val array = input.split(",").map { line -> line.toCharArray().map { c -> c == '@' }.toTypedArray() }.toTypedArray()
    var count = 0
    for (y in array.indices) {
        for (x in array[y].indices) {
//            print(if (array[y][x]) '@' else '.')
            if (array[y][x] && getCountOfAdjacentRollsOfPaper(x, y, array) < 4) {
                count++
//                println("$y $x")
            }
        }
//        println()
    }
    println(count)
}

fun getCountOfAdjacentRollsOfPaper(x: Int, y: Int, array: Array<Array<Boolean>>): Int {
    val positions = arrayOf(
        Pair(x-1, y-1),
        Pair(x, y-1),
        Pair(x+1, y-1),
        Pair(x-1, y),
        Pair(x+1, y),
        Pair(x-1, y+1),
        Pair(x, y+1),
        Pair(x+1, y+1)
    )
    var count = 0
    positions.forEach { pos ->
        if (pos.first in array[0].indices && pos.second in array.indices) {
            if (array[pos.second][pos.first]) {
                count++
            }
        }
    }
    return count
}